    "2015-01-30T21:43:40.121645",nt"name": "fy2015-agency-performance-measures-1f8ec",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains all Fiscal Year 2015
    performance measures reported in the FY 15 Budget Book, by agency and program. The
    file is provided by the Governoru2019s Office of Management and Budget and is available
    at the following websites: Budget.Illinois.gov or http://www.state.il.us/budget/).rnrnThe
    first two (2) columns contain the name of the Agency and the name of the performance
    measure.rnrnColumns three (3) through seven (7) contain the reported data values
    for the performance measures for FY 2011-FY 2013, and estimated and projected values
    for FY 2014 and FY 2015.rnrnColumn eight (8) contains an asterisk (*) if there is
    a footnote attached to the performance measure. Corresponding footnotes can be found
    in the respective state agency Performance Measure tables within the agency narrative
    section in the FY 15 Budget Book, available for download at Budget.Illinois.gov
    or http://www.state.il.us/budget/.rnrnColumns nine (9) through eleven (11) contain
    the program name, the name of the associated Outcome Area and the name of the associated
    Statewide Result Area.",nt"license_title": "License Not Specified",nt"extras":
